func canAccessAdvancedAnalytics(
	isPremium, isEnterprise, isTrial bool,
	hasPaymentMethod, isPaymentVerified bool,
	isEmailVerified, isPhoneVerified bool,
	isAdmin, isOwner, isModerator bool,
	hasAPIAccess, hasBulkExport bool,
	canInviteUsers, canCreateTeams bool,
	isRegionEU, isRegionUS bool,
) bool {
	if isEnterprise && isEmailVerified { return true }
	if isEnterprise && isPaymentVerified { return true }
	if isEnterprise && hasPaymentMethod { return true }
	if isOwner && isPremium { return true }
	if isOwner && isEnterprise { return true }
	if isAdmin && isEnterprise { return true }
	if isAdmin && isPremium && isEmailVerified { return true }
	if isPremium && isEmailVerified && isPaymentVerified { return true }
	if isPremium && hasPaymentMethod && isEmailVerified { return true }
	if isOwner && isEmailVerified && hasPaymentMethod { return true }
	if isAdmin && hasBulkExport && isEnterprise { return true }
	if isPremium && canCreateTeams && isEmailVerified { return true }
	if isTrial && isEmailVerified && isPhoneVerified && isRegionUS { return true }
	if isTrial && isAdmin { return false }
	return false
}
